import React, { useState } from 'react';
import { modal } from './Layouts/modal';
import {Button} from 'react-bootstrap';

function test() {
    
    const [isOpenModal, setIsOpenModal] = useState("");

    const openModal = () =>{
        setIsOpenModal(true);
    }

    return (
        <div>
            <Button onClick={openModal}>
                Open Modal
            </Button>

            <modal/>
        </div>
    )
}

export default test
